Adult and deutonymph.
(
Figures 1–6
). For morphometric data see 
Table 1
. Colour in life brownish. Body oval in shape, slightly widened anteriorly (
Figure 1
) and densely covered with uniform setae. Chelicerae narrow, dagger-like, retractable into idiosoma. Palps (
Figure 2
) slender. Palp genu almost parallel-sided, palp tibia triangular in outline, palp tarsus slightly longer than wide and rounded terminally. Odontus simple, relatively short, hook-like. All segments of palps covered with sparsely distributed setae. All setae on palp trochanter and palp tibia, as well as those that cover the medial and lateral side of palp femur and palp genu, elongated, slender, covered with short, delicate setules. Setae placed at dorsal side of palp femur and palp genu more stout, similar to normal setae covering leg segments. Numerous setae with very short setules present on palp tarsus.

Crista metopica (
Figure 3
) elongated. Anterior sensillary area oval, with two sensillary setae (ASens) placed slightly behind the mid level of sensillary area and covered with setules along the entire stem. Rod of crista narrow, parallel-sided. Posterior sensillary area drop-like in shape, with two sensillary setae (PSens) moved to the posterior margin of sensillary area. PSens longer than ASens and covered with slightly shorter setules. Posterior process of crista weakly marked, shorter than posterior sensillary area of crista. Eyes (
Figure 3
) sessile, each composed of single circular lens, placed laterally to the rod of crista metopica, at the level of anterior part of crista, close to half its length. Dorsal opisthosomal setae (
Figures 5
, 
6A
) uniform in shape, slightly longer at aspidosoma. Setae oval in outline, stout, densely covered with setules outgoing from the main stem. Setules relatively thick at base, then acuminate. Ventral setae similar to those placed on idiosoma dorsum, also uniform but more slender and with more delicate setules. Genital opening (
Figure 4
) surrounded by centrovalves and epivalves. Centrovalval setae delicate, covered with setules, which are more densely distributed in proximal part of the stem. Epivalval setae similar in length to centrovalval ones but stouter and with setules covering the entire stem. In females, two pairs of genital acetabulae, sometimes both pairs shifted to one side of genital opening. Anal opening (
Figure 4
) surrounded by paired valves. Medial valves membraneous, with a row of delicate, sparsely setulose setae arising along the medial margin of each valve. Lateral valves sclerotised, with several setae, which are stouter than those covering the medial valves and arise along the lateral margin of each sclerite.

Legs IV slightly longer than legs I. Legs II and III the shortest (
Figure 1
). Leg segments covered with setae of different 
type
: normal, densely setulose setae (
Figure 6B
) present on all leg segments, confined on tarsi to dorsal part of the segment; more slender and more sparsely setulose setae (
Figure 6C
) present also on coxae; normal, brush-like setae (
Figure 6F
) aggregated along the ventral side of tarsi [setae covering tarsi gradually pass from the robust ones (
Figure 6B
), which are located dorsally, into brush-like setae (
Figure 6F
), which dominate along the ventral part of the segment]; few setae, covered with very short setules (
Figure 6D
), sparsely distributed on all segments, beyond trochanters; few setae of the same 
type
, however slightly thicker and longer (
Figure 6E
) located ventrally at termination of tibiae II–IV; setae of “eupathidium 
type
” (
Figure 6G
) (spinalae according to 
Southcott (1961)
arise along the dorsal side of all telofemora, genua, tibiae and on tarsus I; 
c
. 3–4 vestigialae (
